import { Component } from 'react'
import Link from 'next/link'

class News extends Component {

    constructor(props) {
        super(props);
        this.state = {
            filter_date: ''
        };
    }

    handleChange = (e) => {
        this.setState({
            [e.target.name]: e.target.value
        })
    }

    render () {
      return (
          <div className="container">
            <div className="header">Admin > News<div className="logout_but">Log out</div></div>
            <div className="clear"></div>
            <div className="content_box">
            </div>
        <style jsx global>{`
            html {
                height: 100%;
                font-family:Gotham, "Helvetica Neue", Helvetica, Arial, sans-serif;
                font-size:15px;
                line-height:17px;
                color:#333;
            }
            body{
                margin:0px;
                padding:0px;
                width:100%; 
                height:100%;
            }
            .clear{
                clear:both;
            }
        `}</style>
        <style jsx>{`
            .container{
                height:100%;
            }
            .header{
                height:28px;
                padding:8px;
                background-color:#006; 
                color:#FFF;
                line-height:28px;
                font-weight:bold;
            }
            .content_box{
                height:calc(100% - 60px);
                padding:8px;
            }
            .login_button{
                padding:4px 12px 4px 12px;
                background-color:#006; 
                color:#FFF;
                border-radius:8px;
                cursor:pointer;
            }
            .login_tf{
                font-size:15px;
                padding:4px 12px 4px 12px;
                text-align:center;
                border-radius:8px;
            }
            .logout_but{
                float:right;
                padding:4px 12px 4px 12px;
                color:#FFF;
                cursor:pointer;
            }
        `}</style>
          </div>
      );
    }
}

export default News
